import Jumbotron from 'react-bootstrap/Jumbotron'
import 'bootstrap/dist/css/bootstrap.min.css'
import React from 'react'
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import ListGroup from 'react-bootstrap/ListGroup'
import {notes} from './utils/noteHelpers'

// import {getNote, notes} from './utils/noteHelpers'
/* <ul>
    {notes.map((note) => (
    <li>{note}</li>
    ))}
    </ul>
*/
//const list = notes.map((note) => <li>{note}</li>)
function App() {
  return (
    <container>
      <Jumbotron fluid>
        <Container>
          <h1>Notes by Angelica</h1>
          <p>Här är min note app!</p>
        </Container>
      </Jumbotron>
      <Row>
        <Col sm={4}>
          <ListGroup>
            {notes.map((note) => (
              <ListGroup.Item action variant="info">
                {note}
              </ListGroup.Item>
            ))}
          </ListGroup>
        </Col>
        <Col style={{backgroundColor: 'blue'}}>Editor</Col>
      </Row>
    </container>
  )
}

// getNote(3)

export default App
